import React, { useState } from "react";
import { Navbar, NavbarBrand, NavItem } from "reactstrap";
import { NavLink, Routes, Route } from "react-router-dom";
import "../App.css";
import Home from "./Home";
import Product from "./Product";
import CreateCard from "./CreateCard";
import ProductDetails from "./productDetails";
import AddMember from "../component/AddMember";
import Teams from "./Teams";
import Qutation from "./Qutation";
import B2Bsheet from "./B2Bsheet";
import Salessheet from "./Salessheet";
import SalesSheetCard from "./SalesSheetCard";
import FilterEmail from "./FilterEmail";

// Import Font Awesome CSS and JS files
import "@fortawesome/fontawesome-free/css/all.css";
import "@fortawesome/fontawesome-free/js/all.js";

function MyNavpar() {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
    setIsOpen(!isOpen);
  };

  const closeMenu = () => {
    setIsOpen(false);
  };

  return (
    <div>
      <nav>
        <h1>
          <NavLink to="/" onClick={closeMenu}>
            <i className="fas fa-code"></i> Shamel.Safa
          </NavLink>
        </h1>
        <div className="menu-icon" onClick={toggle}>
          <i className={isOpen ? "fas fa-times" : "fas fa-bars"}></i>
        </div>
        <ul className={isOpen ? "nav-links open" : "nav-links"}>
          <li>
            <NavLink
              to="/Salessheet"
              activeClassName="active"
              onClick={closeMenu}
            >
              SalesSheetForm
            </NavLink>
          </li>
          <li>
            <NavLink to="/item" activeClassName="active" onClick={closeMenu}>
              Product
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/CreateProduct"
              activeClassName="active"
              onClick={closeMenu}
            >
              Create Product
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/AddMember"
              activeClassName="active"
              onClick={closeMenu}
            >
              AddMember
            </NavLink>
          </li>
          <li>
            <NavLink to="/Agent" activeClassName="active" onClick={closeMenu}>
              Agent
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/Qutation"
              activeClassName="active"
              onClick={closeMenu}
            >
              B2B
            </NavLink>
          </li>
          <li>
            <NavLink to="/Mails" activeClassName="active" onClick={closeMenu}>
              Emails
            </NavLink>
          </li>
        </ul>
      </nav>
      {/* ... */}
    </div>
  );
}

export default MyNavpar;
